import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Webhooks from './pages/Webhooks';
import Docs from './pages/Docs';

function App() {
  return (
    <Router>
      <div style={{ display: 'flex' }}>
        <nav style={{ width: '250px', padding: '20px', background: '#f8f9fa', height: '100vh' }}>
          <h3>Dashboard</h3>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li style={{ marginBottom: '10px' }}><Link to="/webhooks">Webhooks</Link></li>
            <li style={{ marginBottom: '10px' }}><Link to="/docs">API Docs</Link></li>
          </ul>
        </nav>
        <main style={{ flex: 1, padding: '20px' }}>
          <Routes>
            <Route path="/webhooks" element={<Webhooks />} />
            <Route path="/docs" element={<Docs />} />
            <Route path="/" element={<h2>Welcome to Payment Gateway</h2>} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
